import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  background: #22b8cf;
  width: 100%;
`;

const ContentsGroup = styled.div`
  width: 1320px;
  display: flex;
  justify-content: space-between;
  height: 200px;
`;

const Boxex = styled.div`
  display: flex;
  justify-content: center;
  flex-direction: column;
  text-align: center;
  width: 300px;
  height: 200px;
  border: 1px solid red;
  .spanText {
    font-size: 5rem;
    color: red;
  }
`;

const PricingPolicy = () => {
  return (
    <Container>
      <ContentsGroup>
        <Boxex>
          <p>월 사용자 수</p>
          <p className="spanText">1000명</p>
        </Boxex>
        <Boxex>A</Boxex>
        <Boxex>A</Boxex>
      </ContentsGroup>
    </Container>
  );
};

export default PricingPolicy;
